// Footer.js
import React from 'react';
import './Footer.css';
import logo from '../Images/logo.png'

function Footer() {
  return (
    <footer style={{ backgroundColor: 'lightgray', padding: '15px 0px', textAlign: 'center' }}>
        <div>
            <div>
                <img class='' src={logo} width="90px" height='90px' alt="logo" />
                <div>Midwest Math Circle 2023</div>
            </div>

            <div class='socials'>

            </div>

            <div class='copyright'>

            </div>
        </div>

        
    </footer>
  );
}

export default Footer;
